import React from "react";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import Home from  "./Pages/home"
import Stats from  "./Pages/stats"
import Stream from  "./Pages/stream"

export default function App() {
  return (
    <Router>
      <div>
        <nav>
          <ul>
            <li>
              <Link to="/">Home</Link>
            </li>
            <li>
              <Link to="/Stats">stats</Link>
            </li>
            <li>
              <Link to="/Stream">Stream</Link>
            </li>
          </ul>
        </nav>

        <Switch>
          <Route path="/Stats">
            <Stats />
          </Route>
          <Route path="/Stream">
            <Stream />
          </Route>
          <Route path="/">
            <Home />
          </Route>
        </Switch>
      </div>
    </Router>
  );
}



function About() {
  return <h2>About</h2>;
}

function Users() {
  return <h2>Users</h2>;
}
